text:
* {
    box-sizing: border-box;
}

a {
    text-decoration: none;
}

body {
    font-family: Bold_LABEL;
    color: #000;
}

.modal a {
    text-decoration: none;
    color: #fff;
}

.modal a:active {
    transform: scale(0.95);
}

.opaque {
    background: #000;
}

.bottom-bar {
    align-items: center;
    justify-content: space-around;
    display: flex;
    flex-direction: row;
    position: fixed;
    width: 100%;
    bottom: 0;
    left: 0;
    background: #fff;
}

.top-bar {
    position: fixed;
    width: 100%;
    top: 0;
    left: 0;
    align-items: center;
    display: flex;
    flex-direction: row;
    z-index: 2;
}

.top-bar .inner {
    margin: 10px;
    padding: 5px 10px;
    border-radius: 5px;
    background: rgba(0, 0, 0, 0.6);
    color: #fff;
    align-items: center;
    display: flex;
    flex: 1;
}

.top-bar .inner .text {
    text-align: right;
    flex-grow: 1;
}

.tab {
    text-align: center;
    font-size: 12px;
    color: #666;
}

.tab.active {
    color: #FFC13F;
}

.btn {
    background: #FFC13F;
    color: #fff;
    padding: 10;
    border-radius: 5px;
}

.btn:active {
    transform: scale(0.95);
}

.modal {
    position: fixed;
    top: 0;
    left: 0;
    bottom: 0;
    right: 0;
    display: flex;
    flex-direction: column;
    color: #333;
}

.modal .scrollable {
    flex: 1;
    overflow-y: auto;
    -webkit-overflow-scrolling: touch;
}

.modal .header {
    background: #333;
    padding: 46px 0 0 0;
    height: 96px;
    color: #fff;
    font-size: 18px;
}

.modal .header .close {
    position: absolute;
    right: 10px;
    top: 58px;
}

.modal .block {
    display: flex;
    align-items: center;
    justify-content: center;
}

.modal .row {
    display: flex;
    flex-direction: row;
    align-items: center;
}

.text-s {
    font-size: 12px;
}

.text-xl {
    font-size: 24px;
}

.text-l {
    font-size: 20px;
}

.text-center {
    text-align: center;
}

.text-light {
    font-family: Regular_LABEL;
}

.route-cost {
    background: #FFC13F;
    color: #fff;
    width: 100px;
    height: 40px;
    line-height: 40px;
    text-align: center;
    border-radius: 5px;
}

.route-tabs {
    padding: 0 5px;
    display: flex;
    flex-direction: row;
    overflow-x: auto;
    -webkit-overflow-scrolling: touch;
}

.route-tab {
    font-size: 14px;
    flex: 1 0 auto;
    background: #f2f2f2;
    border-radius: 5px;
    margin: 10px 5px;
    padding: 10px;
    display: flex;
    flex-direction: row;
    align-items: center;
}

.route-tab .route-name {
    flex: 1;
    margin-right: 10px;
    white-space: nowrap;
}

.route-tab.active {
    background: #FFC13F;
    color: #fff;
}

.border-top {
    border-top: 0.5px solid #ddd;
}

.row .box {
    border: 1px solid #eee;
    border-radius: 5px;
    flex: 1;
    padding: 10px;
}

.row .spacer {
    width: 10px;
}

glsl3.vert:
precision highp float;
uniform CCGlobal {
  vec4 cc_time;

  vec4 cc_screenSize;

  vec4 cc_screenScale;

  vec4 cc_nativeSize;

  mat4 cc_matView;
  mat4 cc_matViewInv;
  mat4 cc_matProj;
  mat4 cc_matProjInv;
  mat4 cc_matViewProj;
  mat4 cc_matViewProjInv;
  vec4 cc_cameraPos;

  vec4 cc_exposure;

  vec4 cc_mainLitDir;

  vec4 cc_mainLitColor;

  vec4 cc_ambientSky;
  vec4 cc_ambientGround;
};
uniform CCLocal {
  mat4 cc_matWorld;
  mat4 cc_matWorldIT;
};

in vec3 a_position;
in vec4 a_color;
out vec4 v_color;

#if USE_TEXTURE
in vec2 a_uv0;
out vec2 v_uv0;
#endif

void main () {
  vec4 pos = vec4(a_position, 1);

  #if CC_USE_MODEL
  pos = cc_matViewProj * cc_matWorld * pos;
  #else
  pos = cc_matViewProj * pos;
  #endif

  #if USE_TEXTURE
  v_uv0 = a_uv0;
  #endif

  v_color = a_color;

  gl_Position = pos;
}

glsl3.frag:
precision highp float;

#if USE_ALPHA_TEST

  uniform ALPHA_TEST {
    float alphaThreshold;
  }
#endif

void ALPHA_TEST (in vec4 color) {
  #if USE_ALPHA_TEST
      if (color.a < alphaThreshold) discard;
  #endif
}

void ALPHA_TEST (in float alpha) {
  #if USE_ALPHA_TEST
      if (alpha < alphaThreshold) discard;
  #endif
}

in vec4 v_color;

#if USE_TEXTURE
in vec2 v_uv0;
uniform sampler2D texture;
#endif

void main () {
  vec4 o = vec4(1, 1, 1, 1);

  #if USE_TEXTURE
  o *= texture(texture, v_uv0);
    #if CC_USE_ALPHA_ATLAS_TEXTURE
    o.a *= texture2D(texture, v_uv0 + vec2(0, 0.5)).r;
    #endif
  #endif

  o *= v_color;

  ALPHA_TEST(o);

  gl_FragColor = o;
}

glsl1.vert:
precision highp float;
uniform mat4 cc_matViewProj;
uniform mat4 cc_matWorld;

attribute vec3 a_position;
attribute vec4 a_color;
varying vec4 v_color;

#if USE_TEXTURE
attribute vec2 a_uv0;
varying vec2 v_uv0;
#endif

void main () {
  vec4 pos = vec4(a_position, 1);

  #if CC_USE_MODEL
  pos = cc_matViewProj * cc_matWorld * pos;
  #else
  pos = cc_matViewProj * pos;
  #endif

  #if USE_TEXTURE
  v_uv0 = a_uv0;
  #endif

  v_color = a_color;

  gl_Position = pos;
}

glsl1.frag:
precision highp float;

#if USE_ALPHA_TEST

  uniform float alphaThreshold;
#endif

void ALPHA_TEST (in vec4 color) {
  #if USE_ALPHA_TEST
      if (color.a < alphaThreshold) discard;
  #endif
}

void ALPHA_TEST (in float alpha) {
  #if USE_ALPHA_TEST
      if (alpha < alphaThreshold) discard;
  #endif
}

varying vec4 v_color;

#if USE_TEXTURE
varying vec2 v_uv0;
uniform sampler2D texture;
#endif

void main () {
  vec4 o = vec4(1, 1, 1, 1);

  #if USE_TEXTURE
  o *= texture2D(texture, v_uv0);
    #if CC_USE_ALPHA_ATLAS_TEXTURE
    o.a *= texture2D(texture, v_uv0 + vec2(0, 0.5)).r;
    #endif
  #endif

  o *= v_color;

  ALPHA_TEST(o);

  gl_FragColor = o;
}

